import { createUseStyles } from "react-jss";
const ackgroundImage = "../../../images/delivery.png";

const DeliveryPage = () => {

    const styles = createUseStyles({
        listItem: {
            marginLeft: "80px",
            width: "100%",
            backgroundRepeat: "no-repeat",
            backgroundPosition: "top right"
        },
        delivery: {
            backgroundImage: `url(${ackgroundImage})`
        }
    });

    console.log(ackgroundImage)

    const classes = styles()

    return (
        <div className={classes.listItem + classes.delivery}>
            <h3 className="services-list-item-title">Кредит</h3>
            <p className="services-list-item-desc">Залезть в долговую яму стало проще!<br />
                Кредитные консультанты придут вам на помощь.</p>
            <a className="services-credit-btn" href="link">Отправить заявку</a>
        </div>
    )
}

export default DeliveryPage
